AccessorFunc(b,"m_iSelectedNumber","SelectedNumber")
Derma_Install_Convar_Functions(b)
function b:Init()
self:SetSelectedNumber(0)
self:SetSize(60,30)
end
function b:UpdateText()
local c=input.GetKeyName(self:GetSelectedNumber())
if not c then c="NONE"end
c=language.GetPhrase(c)
self:SetText(c)
end
function b:DoClick()
self:SetText("<Key>")
input.StartKeyTrapping()
self.Trapping=true 
end
function b:DoRightClick()
self:SetText("NONE")
self:SetValue(0)
end
function b:SetSelectedNumber(d)
self.m_iSelectedNumber=d
self:ConVarChanged(d)
self:UpdateText()
self:OnChange(d)end
function b:Think()
if input.IsKeyTrapping()and self.Trapping then 
local e=input.CheckKeyTrapping()
if e then if e==KEY_ESCAPE then 
self:SetValue(self:GetSelectedNumber())
else 
self:SetValue(e)
end
self.Trapping=false 
end 
end
self:ConVarNumberThink()
end
function b:SetValue(f)
self:SetSelectedNumber(f)
end
function b:GetValue()
return self:GetSelectedNumber()
end
function b:OnChange()end
derma.DefineControl("DBinder","",b,"DButton")
surface.CreateFont("B",{font="Tahoma",size=18})
surface.SetFont("B")





